import React from 'react'

function SocialLogin() {
    return (
        <div>
            <h1>Login with another provider:</h1>
            <div>
                <h3>Github</h3><ion-icon name="logo-github" size="large"></ion-icon>
                <h3>Google</h3><ion-icon name="logo-google"></ion-icon>
            </div>
        </div>
    )
}

export default SocialLogin
